const users = [
	{id: 1, name: 'user1', surn: 'surn1', age: 30},
	{id: 2, name: 'user2', surn: 'surn2', age: 31},
	{id: 3, name: 'user3', surn: 'surn3', age: 32},
];

function App(){
  const res = users.map((elem) => {
    return (
      <tr key={elem.id}>
        <td>{elem.name}</td>
        <td>{elem.surn}</td>
        <td>{elem.age}</td>
      </tr>
    )
  })

  return <table>
    <thead>
      <tr>
        <td>Name</td>
        <td>Surname</td>
      </tr>
    </thead>
    <tbody>
     {res}
    </tbody>
  </table>
}


export default App;

